import React from 'react'
import Header from './Header'
import { useStateValue } from './StateProvider'
import "./Checkout.css"
function Checkout() {
    const [{basket}]=useStateValue()
    return (
        <div className="checkout">
            <Header/>
            <div>
                <img className="checkout_ad" src="https://images-eu.ssl-images-amazon.com/images/G/31/prime/primeday/PD18/AAFeedback/Bruno/1500x300_Starts_Banner_v2._CB474351192_.gif" alt="banner"/>
                {basket.length===0?(<div></div>):(<div></div>)}
            </div>
        </div>
    )
}

export default Checkout
